def max_moves_for_final_X(T: int, X_f: list) -> list:
    """"""

    def bs(val, l):
        i = 0
        j = len(l) - 1
        ans = -1
        while i <= j:
            mid = i + (j - i) // 2
            if l[mid] <= val:
                ans = mid
                i = mid + 1
            else:
                j = mid - 1
        return ans + 1

    def bst(i, val):
        j = 100000000000
        ans = -1
        while i <= j:
            mid = i + (j - i) // 2
            if mid ** 2 > val:
                ans = mid
                j = mid - 1
            else:
                i = mid + 1
        return ans
    e = 10 ** 9
    l = [1]
    sum = 1
    while l[-1] <= e:
        x = bst(l[-1] + 1, sum)
        sum += x ** 2
        l.append(x)
    results = []
    for n in X_f:
        results.append(bs(n, l))
    return results
